import React from "react";
import { Button } from "reactstrap";

import { auth } from "../firebase";

let signOut  = () => {
  localStorage.removeItem("UID");
  return(auth.doSignOut)
}

const SignOutButton = () => (
  <Button color="info" onClick={()=> signOut()}>
    Sign Out
  </Button>
);

export default SignOutButton;
